import React from 'react';
import './App.css';
import { Person } from './Person/Person.js'

class App extends React.Component{
  render(){
    return(
      <div className="App">
        <h1>Hello World</h1>
        <Person name="Max" age="28" />
        <Person name="Manu" age="29" />
        <Person name="Wj" age="27" />
      </div>
    )
  }
}

export default App;
